import React from 'react';
import PropTypes from 'prop-types';
import classNames from 'classnames';
import styled from "styled-components";
import { Link } from 'react-router-dom';
import { FaMapMarkerAlt, FaRegPaperPlane, FaPhone } from "react-icons/fa";
import FooterSocial from './partials/FooterSocial';

const propTypes = {
  topOuterDivider: PropTypes.bool,
  topDivider: PropTypes.bool
}

const defaultProps = {
  topOuterDivider: false,
  topDivider: false
}

const Nav = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  width: 100%;
  background-color: #00A0C1;
  padding: 2rem 0 3rem 0;
`;

const Container = styled.div`
  display: flex;
  width: 100%;
  margin: 0 auto;
`;

const Footer = ({
  className,
  topOuterDivider,
  topDivider,
  ...props
}) => {

  const classes = classNames(
    'site-footer center-content-mobile',
    topOuterDivider && 'has-top-divider',
    className
  );

  return (
    <footer
      {...props}
      className={classes}
    >

      <Container>
        <Nav>
          <div className="footer-nav">
            <ul className="list-reset" style={{ padding: "0 20px" }}>
              <h5 style={{ padding:" 0 12px" }}>
                Informações
              </h5>
              <li>
                <a to="#0">Início</a>
              </li>
              <li>
                <a to="#1">Sobre Nós</a>
              </li>
              <li>
                <a to="#3">Trabalhe Conosco</a>
              </li>
            </ul>
          </div>

          <div className="footer-nav">
            <ul className="list-reset" style={{ padding: "0 20px" }}>
              <h5 style={{ padding:" 0 12px" }}>
                Informações
              </h5>
              <li>
                <a to="#0">Início</a>
              </li>
              <li>
                <a to="#1">Sobre Nós</a>
              </li>
              <li>
                <a to="#3">Trabalhe Conosco</a>
              </li>
            </ul>
          </div>

          <div className="footer-nav">
            <ul className="list-reset">
              <h5>
                Endereço
              </h5>
              <li>
                <FaPhone/>
                <Link to="#0">(66) 99639-0632</Link>
              </li>
              <li>
                <FaMapMarkerAlt/>
                <Link to="#0">Colíder - MT, 78500-000</Link>
              </li>
              <li>
                <FaRegPaperPlane/>
                <Link to="#0">confinamentoabacaxiquebrado@outlook.com</Link>
              </li>
            </ul>
          </div>
        </Nav>
      </Container>

      <div className="container">

        <div className={
          classNames(
            'site-footer-inner',
            topDivider && 'has-top-divider'
          )}>

          <div className="footer-top space-between text-xxs">
          </div>

          <div className="footer-bottom space-between text-xxs invert-order-desktop">
            <FooterSocial />

            <div className="footer-copyright">
              © Todos os direitos reservados a ABACAXIQUEBRADO
            </div>
          </div>

        </div>
      </div>
    </footer>
  );
}

Footer.propTypes = propTypes;
Footer.defaultProps = defaultProps;

export default Footer;
